/*Table structure for table `t_plan` */

DROP TABLE IF EXISTS `t_plan`;

CREATE TABLE `t_plan` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `create_date_time` datetime DEFAULT NULL COMMENT '计划任务创建时间',
  `end_date_time` datetime DEFAULT NULL COMMENT '计划任务截止时间',
  `name` varchar(50) DEFAULT NULL COMMENT '任务名称',
  `order_no` int(11) DEFAULT NULL,
  `remark` varchar(200) DEFAULT NULL,
  `state` int(5) NOT NULL COMMENT '计划状态...',
  `worker_ids` varchar(200) DEFAULT NULL COMMENT '执行者Ids',
  `user_id` int(11) DEFAULT NULL COMMENT '计划任务，创建人',
  PRIMARY KEY (`id`),
  KEY `FK4bdasbb2d1xnaym411pe3aybl` (`user_id`),
  CONSTRAINT `FK4bdasbb2d1xnaym411pe3aybl` FOREIGN KEY (`user_id`) REFERENCES `t_a_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

