  `num` varchar(50) DEFAULT NULL COMMENT '仪器编号.',
  `order_no` int(9) DEFAULT NULL COMMENT '序号',
  `rock_id` int(11) DEFAULT NULL,
  `c` decimal(10,2) DEFAULT NULL COMMENT '系数c',
  `unit` int(10) DEFAULT NULL COMMENT '检出限单位单位.',
  PRIMARY KEY (`id`),
  KEY `FKcxcny72vdqbemd7ayxe0onfsf` (`rock_id`),
  CONSTRAINT `FKcxcny72vdqbemd7ayxe0onfsf` FOREIGN KEY (`rock_id`) REFERENCES `t_a_rock` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1634 DEFAULT CHARSET=utf8;

