/*Table structure for table `t_task` */

DROP TABLE IF EXISTS `t_task`;

CREATE TABLE `t_task` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `project` varchar(100) DEFAULT NULL COMMENT '对应的检测项目 Au,Ag',
  `register_id` int(11) NOT NULL COMMENT '对应的检测记录 ',
  `send_sample_id` int(11) DEFAULT NULL COMMENT '上传的送样id',
  `names` varchar(50) DEFAULT NULL COMMENT '这组人的人名集合',
  `type` int(2) NOT NULL COMMENT '1第一次   2复查   ',
  `time_str` varchar(55) DEFAULT NULL COMMENT '时间搓',
  `bianhao` varchar(50) DEFAULT NULL COMMENT '仪器编号',
  `create_date_time` datetime DEFAULT NULL COMMENT '创建时间',
  `danwei` varchar(50) DEFAULT NULL COMMENT '检测结果单位',
  `method` varchar(50) DEFAULT NULL COMMENT '检测方法',
  `name` varchar(50) DEFAULT NULL COMMENT '仪器名称',
  `result` decimal(16,6) DEFAULT NULL COMMENT '检测结果',
  `shidu` varchar(50) DEFAULT NULL COMMENT '湿度',
  `shiji` decimal(15,5) DEFAULT NULL COMMENT '实际误差',
  `smaple_name` varchar(100) DEFAULT NULL COMMENT '样品名称  原样编号 ',
  `state` int(5) NOT NULL COMMENT '0样品  1平行样  2标样 3金标样    ',
  `test_number` varchar(55) DEFAULT NULL COMMENT '检测编号.',
  `use_it` int(11) NOT NULL COMMENT '0不使用  1使用    ',
  `user_ids` varchar(50) DEFAULT NULL COMMENT '标识',
  `wendu` varchar(50) DEFAULT NULL COMMENT '温度',
  `xinghao` varchar(50) DEFAULT NULL COMMENT '仪器型号',
  `yunxu` decimal(15,5) DEFAULT NULL COMMENT '允许误差',
  `is_result` int(5) NOT NULL COMMENT '0没有上伟结果  1上传结果成功      ',
  `update_date_time` datetime DEFAULT NULL COMMENT '结果上传时间',
  `bq` decimal(15,6) DEFAULT NULL COMMENT '比特结果',
  `lei` decimal(15,6) DEFAULT NULL COMMENT '镭含量',
  `pingheng` decimal(15,6) DEFAULT NULL COMMENT '铀镭平衡系数',
  PRIMARY KEY (`id`),
  KEY `FKhh8rhq22ulwbn902e61npd1vs` (`send_sample_id`),
  CONSTRAINT `FKhh8rhq22ulwbn902e61npd1vs` FOREIGN KEY (`send_sample_id`) REFERENCES `t_send_sample` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=45543 DEFAULT CHARSET=utf8;

